import React, { Component } from "react";
import Card from "react-bootstrap/Card";
import CardDeck from "react-bootstrap/CardDeck";
import Button from "react-bootstrap/Button";
import BurgerImg from "../components/assets/Burger.png";
// import BurgerImg from "../components/assets/Burger.png";
// import BurgerImg from "../components/assets/Burger.png";
// import BurgerImg from "../components/assets/Burger.png";

export default class projects extends Component {
  render() {
    return (
      <div>
        <CardDeck>
          {/* CARD 1 */}
          <Card>
            <Card.Img variant="top" src={BurgerImg} />
            <Card.Body>
              <Card.Title><h4>Eat-Da-Burger</h4></Card.Title>
              <Card.Text>
                This is a burger logger app with MySQL, Node, Express, Handlebars and a homemade ORM.
              </Card.Text>
              <Button variant="primary">Site</Button>{' '}
                <Button variant="secondary">R</Button>{' '}
            </Card.Body>
            <Card.Footer>
              <small className="text-muted">Last updated 3 mins ago</small>
            </Card.Footer>
          </Card>
          <Card>
            <Card.Img variant="top" src="holder.js/100px160" />
            <Card.Body>
              <Card.Title>Card title</Card.Title>
              <Card.Text>
                This card has supporting text below as a natural lead-in to additional
        content.{' '}
              </Card.Text>
            </Card.Body>
            <Card.Footer>
              <small className="text-muted">Last updated 3 mins ago</small>
            </Card.Footer>
          </Card>
          <Card>
            <Card.Img variant="top" src="holder.js/100px160" />
            <Card.Body>
              <Card.Title>Card title</Card.Title>
              <Card.Text>
                This is a wider card with supporting text below as a natural lead-in to
                additional content. This card has even longer content than the first to
                show that equal height action.
      </Card.Text>
            </Card.Body>
            <Card.Footer>
              <small className="text-muted">Last updated 3 mins ago</small>
            </Card.Footer>
          </Card>
        </CardDeck>
      </div>
    );
  }
}
